import React from "react";
import "./styles/Home.css";
import ParticleBackground from "./components/ParticleBackground";

function Home() {
  return (
    <div>
      <div className={"main-content"}>
        <h3 className={"title-text"}>Hi, I'm James.</h3>
      </div>
      <ParticleBackground/>
    </div>
  );
}

export default Home;
